import React from 'react';
import { motion } from 'framer-motion';
import { ExternalLink, Zap, Brain, Database, Network } from 'lucide-react';

const ProjectCard = ({ project, onClick }) => {
  const getTypeColor = (type) => {
    const colors = {
      'Complement': '#ff69b4',
      'Direct Competitor': '#ff1493',
      'Potential Partner': '#ffc0cb',
      'Research Partner': '#ffb6c1',
      'Technology Provider': '#ffa0b4',
      'Service Partner': '#ff91a4'
    };
    return colors[type] || '#ff69b4';
  };

  const getTypeIcon = (type) => {
    switch (type) {
      case 'Complement':
        return <Zap size={16} />;
      case 'Direct Competitor':
        return <Network size={16} />;
      case 'Research Partner':
        return <Brain size={16} />;
      default:
        return <Database size={16} />;
    }
  };

  return (
    <motion.div
      className="project-card"
      layout
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      exit={{ opacity: 0, y: -20 }}
      whileHover={{ 
        scale: 1.03,
        boxShadow: '0 10px 25px rgba(255, 105, 180, 0.15)'
      }}
      whileTap={{ scale: 0.98 }}
      onClick={onClick}
      style={{ 
        '--type-color': getTypeColor(project.type),
        cursor: 'pointer'
      }}
    >
      <div className="project-card-header">
        <div className="project-title-section">
          <h4 className="project-name">{project.name}</h4>
          <motion.div 
            className="project-type-badge"
            initial={{ scale: 0 }}
            animate={{ scale: 1 }}
            transition={{ delay: 0.1 }}
          >
            {getTypeIcon(project.type)}
            <span>{project.type}</span>
          </motion.div>
        </div>
        <motion.button
          className="external-link-btn"
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
          onClick={(e) => {
            e.stopPropagation();
            window.open(project.website, '_blank');
          }}
        >
          <ExternalLink size={16} />
        </motion.button>
      </div>

      <p className="project-description">{project.description}</p>

      <div className="project-metrics">
        <div className="metric-row">
          <div className="metric-item">
            <span className="metric-label">Synergy</span>
            <div className="metric-bar">
              <motion.div 
                className="metric-fill"
                initial={{ width: 0 }}
                animate={{ width: `${project.synergy * 10}%` }}
                transition={{ delay: 0.2, duration: 0.6 }}
              />
            </div>
            <span className="metric-value">{project.synergy}</span>
          </div>
        </div>

        <div className="metric-row">
          <div className="metric-item">
            <span className="metric-label">Data Focus</span>
            <div className="metric-bar">
              <motion.div 
                className="metric-fill"
                initial={{ width: 0 }}
                animate={{ width: `${project.dataFocus * 10}%` }}
                transition={{ delay: 0.3, duration: 0.6 }}
              />
            </div>
            <span className="metric-value">{project.dataFocus}</span>
          </div>
        </div>

        <div className="metric-row">
          <div className="metric-item">
            <span className="metric-label">AI Integration</span>
            <div className="metric-bar">
              <motion.div 
                className="metric-fill"
                initial={{ width: 0 }}
                animate={{ width: `${project.aiIntegration * 10}%` }}
                transition={{ delay: 0.4, duration: 0.6 }}
              />
            </div>
            <span className="metric-value">{project.aiIntegration}</span>
          </div>
        </div>

        <div className="metric-row">
          <div className="metric-item">
            <span className="metric-label">Decentralization</span>
            <div className="metric-bar">
              <motion.div 
                className="metric-fill"
                initial={{ width: 0 }}
                animate={{ width: `${project.decentralization * 10}%` }}
                transition={{ delay: 0.5, duration: 0.6 }}
              />
            </div>
            <span className="metric-value">{project.decentralization}</span>
          </div>
        </div>
      </div>

      <motion.div 
        className="project-features"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.6 }}
      >
        <div className="features-list">
          {project.keyFeatures.slice(0, 2).map((feature, index) => (
            <motion.span 
              key={index} 
              className="feature-tag"
              initial={{ scale: 0 }}
              animate={{ scale: 1 }}
              transition={{ delay: 0.7 + index * 0.1 }}
            >
              {feature}
            </motion.span>
          ))}
          {project.keyFeatures.length > 2 && (
            <span className="feature-more">+{project.keyFeatures.length - 2} more</span>
          )}
        </div>
      </motion.div>

      <motion.div 
        className="card-hover-indicator"
        initial={{ opacity: 0 }}
        whileHover={{ opacity: 1 }}
        transition={{ duration: 0.2 }}
      >
        Click for details
      </motion.div>
    </motion.div>
  );
};

export default ProjectCard;
